q = load "UX_Sample_Data";
result = group q by ('Photo', 'Name');
result = foreach result generate q.'Photo' as '     ', q.'Name' as '', sum(q.'Revenue') as '   ',sum(q.'Revenue') as '    ';
result = order result by ('   ' desc);
result = limit result 2000;

